    description: "<body>\n                            \n\n\n\n\n\n\t\t\t\t\t\t\t\n<p><font color=\"#ff6600\"><strong>View 1280*960 pics of the bat <a href=\"http://paris3d.9online.fr/ecoleWP.html\" rel=\"external nofollow\"><font color=\"#ff6600\">HERE</font></a></strong></font></p>\n<p>This 3X4 Art Deco bat is based on an existing Parisian elementary school, built in 1929 and located at rue St-Martin. It can be used either in a <abbr title=\"Wall-to-Wall\">W2W</abbr> environment or not.</p>\n<p><font>Dependencies: </font><font><strong><a href=\"https://www.simtropolis.com/stex/index.cfm?page=1&amp;keyword=PORKIE%20PROPS&amp;type=all\" rel=\"external nofollow\"><font color=\"#ff6600\">PORKIE PROPS VOL1</font></a></strong> and <strong><a href=\"https://www.simtropolis.com/stex/index.cfm?page=1&amp;keyword=PORKIE%20PROPS&amp;type=all\" rel=\"external nofollow\"><font color=\"#ff6600\">PORKIE PROPS VOL2</font></a></strong></font></p>\n<ul><li>students capacity=1000 </li>    <li>\n<font>plop cost=500</font>    </li>\n<li>\n<font>bulldoze cost=100</font> </li>    <li>\n<font>catalog capacity=600, cata month cost=550</font> </li>    <li>\n<font>coverage radius=450</font> </li>    <li>\n<font>demand created: $=40, $$=10</font> </li>    <li>\n<font>budget cost=500</font> </li>    <li>\n<font>EQ boost=24</font> </li>    <li>\n<font>water=10, power=3</font> </li>    <li>\n<font>effectiveness &amp; popVSdistance are standart values.</font> </li>\n</ul><p>Plop it, rate it and visit my <strong><a href=\"http://paris3d.9online.fr/\" rel=\"external nofollow\"><font color=\"#ff6600\">PARIS 3D GALLERY</font></a></strong>. You're welcome!</p>\n\n\t\t\t\t\t\t</body>"
