    description: "<body>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>\n\tHagestraat (Spaarne) Dutch Riverside Buildings\n</p>\n\n<p>\n\tTwo buildings that are neighbouring buildings in real-life too. They overlook the river Spaarne in downtown Haarlem, Holland. The stepped gable is a nice example of Dutch architecture around 1610-1630 and the left building has probably been built shortly after the French occupation ended. My guess is that only to front gable was rebuilt by 1820 and the inside and back side are in fact much older.\n</p>\n\n<p>\n\t<strong><span style=\"color:#c0392b;\">This is Version 2</span></strong>.\n</p>\n\n<p>\n\tIn all cases players who have previous versions installed of these lots are required to bulldoze these lots in their cities and remove them from their plugins folder before installing this update. For removing old versions you need to run the included cleanitol scrip with the<br>\n\t<a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\" rel=\"\">nos.17's SC4 Cleanitol</a> or with the\_<a href=\"https://www.sc4evermore.com/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\" rel=\"external nofollow\"><abbr title=\"BATT Squad Certification\">BSC</abbr> Cleanitol TM tool</a>\n</p>\n\n<p>\n\tSTATS R$$$ 1x1:\n</p>\n\n<p>\n\tLot size : \_ \_ \_ \_ \_ 1x1<br>\n\tGrowth Stage:\_\_ \_ \_ \_ 6 (medium &amp; high density residential zoning)<br>\n\tBulldoze Cost: \_ \_ \_  302<br>\n\tCapacity Satisfied: \_R$ - 65, R$$ - 37 R$$$ - 18<br>\n\tPollution: \_ \_ \_ \_ \_ 1 (Air)/ 1 (Water)/ 4 (Garbage)<br>\n\tPollution Radius: \_ \_6/7/0<br>\n\tPower Consumed:\_\_ \_ \_ \_ 2 Mwh<br>\n\tWater Consumed: \_ \_ \_6 Gal/Month<br>\n\tBuilding Style: \_ \_ \_Euro/NY<br>\n\tOccupant Group:\_\_ \_ \_ \_ High Wealth Residential Building\n</p>\n\n<p>\n\t<br>\n\tDependencies:\_\n</p>\n\n<p>\n\tNONE*\n</p>\n\n<p>\n\t*Alternatively you can use the\_<a href=\"https://www.sc4evermore.com/index.php/downloads/download/22-dependencies/171-haarl-mega-props-dutch-vol-01\" rel=\"external nofollow\">Haarlemmergold Dutch MEGA Pack v2</a>, that contains the essential model for this upload.\n</p>\n\n<p>\n\t<br>\n\t<strong>Installation</strong>:<br>\n\tCopy/Extract the <strong>Haarlemmergold </strong>parent folder into your plugins. If you extracted the ~<em>Documents </em>folder into you plugins too, it's highly recommended to keep it, but move it out of the Plugins folder.\n</p>\n\n<p>\n\tTo <strong>Un-Install</strong> the files, simply bulldoze every lot from this download in your cities and delete the files from the plugins folder afterwards.<br>\n\t\_\n</p>\n\n<p>\n\t<span style=\"font-size:10px;\"><span style=\"color:#2980b9;\">Tyberius06 edit; see change log, 22.07.2024</span></span>\n</p>\n\n\t\t\t\t\t\t</body>"
