  simtropolis/34150:
    assetId: simtropolis/34150-wanng-paris-pack-1-r
    authors:
      - WannGLondon
    category: 105-building-sets
    dependencies: []
    description: "<body>\n\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\t<div style=\"position:absolute; top:0px; right:0px;\">\n\t\t\t\t\t\t\t\t  <img _title=\"This is a Popular File\" alt=\"\" class=\"ipsImage\" data-ipstooltip=\"\" src=\"https://www.simtropolis.com/library/misc/big-heart-icon.png\" style=\"\" width=\"34\" height=\"53\">\n\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\n<p>\n\tMany Parisian models\_have been created by a multitude of BATters, but I always thought simple, 1x2 lots (specifically low-wealth) were missing when attempting to create a realistic Parisian-inspired city. Here are mine. They are lacking in detail &amp; grit compared to some of Xannepan/JENX's awesome models, but I hope to improve in this area. Anyway, their subdued colors should provide a nice look with other Parisian buildings. I made corner versions of one <abbr title=\"Building Architect Tool\">BAT</abbr> in particular and one is modeled after Edith Piaf's supposed birthplace on the Rue de Belleville in Paris. In fact, all of these models are based on ones found on the Rue de Belleville.\n</p>\n\n<p>\n\tI intend to do some medium &amp; high wealth models as well.\n</p>\n\n<p>\n\t- Low wealth residential (stages 4, 5 &amp; 6)\n</p>\n\n<p>\n\t- Euro Tileset\n</p>\n\n<p>\n\t- Medium &amp; High Density zones\n</p>\n\n<p>\n\t- Nightlighted, either MaxisNite or DarkNite*\n</p>\n\n<p>\n\t- No dependencies\n</p>\n\n<p>\n\t*DarkNite version requires SimFox's DayNNite Mod\n</p>\n\n<p>\n\t*These have been tested, however please let me know if you find any issues\n</p>\n\n\t\t\t\t\t\t</body>"
