    description: "<body>\n\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\t<div style=\"position:absolute; top:0px; right:0px;\">\n\t\t\t\t\t\t\t\t  <img _title=\"This is a Popular File\" alt=\"\" class=\"ipsImage\" data-ipstooltip=\"\" src=\"https://www.simtropolis.com/library/misc/big-heart-icon.png\" style=\"\" width=\"34\" height=\"53\">\n\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\tHappy New Year community! I have been sitting on these for a bit and finally got some time to upload. A pack of Mediterranean residential and commercial buildings based on those found on the French Riviera. In the DarkNite set, a large Mediterranean-inspired hotel is included as a CS$$$ plop - please feel free to delete the lot/desc file and lot to your heart's content (you know I stink at lotting).\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- Euro &amp; Houston tilesets\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- Medium zones\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- Nightlighted, either MaxisNite or DarkNite*\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- No dependencies\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t*DarkNite version requires SimFox's DayNNite Mod\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t*These have been tested, however please let me know if you find any issues\n</p>\n\n\t\t\t\t\t\t</body>"
