    description: "<body>\n\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\t<div style=\"position:absolute; top:0px; right:0px;\">\n\t\t\t\t\t\t\t\t  <img _title=\"This is a Popular File\" alt=\"\" class=\"ipsImage\" data-ipstooltip=\"\" src=\"https://www.simtropolis.com/library/misc/big-heart-icon.png\" style=\"\" width=\"34\" height=\"53\">\n\t\t\t\t\t\t\t\t</div>\n\t\t\t\t\t\t\t\n\t\t\t\t\t\t\t\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\tA bit of Marseille and Nice for you for the community. Also, for fun, I created a Marseille-inspired <abbr title=\"Building Architect Tool\">BAT</abbr> with a rooftop restaurant.\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- Euro &amp; Houston tilesets\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- Medium/High density\_zones\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- Nightlighted, either MaxisNite or DarkNite*\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t- No dependencies\n</p>\n\n<p style=\"background-color:#ffffff;color:#353535;font-size:14px;\">\n\t*DarkNite version requires SimFox's DayNNite Mod\n</p>\n\n\t\t\t\t\t\t</body>"
