      - sc4evermore/3-sc4d-lex-legacy-bsc-common-dependencies-pack
    description: "<body>\n\n\n\n<p>\n\tDocumentacin en Espaol incluida en la descarga.\n</p>\n\n<p>\n\t<strong>Description</strong><br>\n\tThis is a pack of japanese <abbr title=\"Wall-to-Wall\">w2w</abbr> growable lots for your dense urban environments, their style makes them look great in any kind of city, not just asian ones. Ive taken these building models, given them new stats, put them in lots and even combined some of them together to achieve that dense, built-up look of a modern downtown.\n</p>\n\n<p>\n\t<strong>Installation</strong><br>\n\tJust unzip the folder with the lot files anywhere in your Plugins directory. It's recommended to keep the folder structure intact to help maintain your content organized.<br>\n\tDon't extract the Documentation files to your Plugins folder!\n</p>\n\n<p>\n\t<strong>Uninstallation</strong><br>\n\tMake sure you bulldoze every instance of these buildings you may have in your cities. After that, remove the files from your Plugins folder.\n</p>\n\n<p>\n\t<strong>Dependencies</strong><br>\n\tMake sure you have all the files in your Plugins, if you don't, you will get brown boxes instead of the actual buildings and some textures could also be missing.<br>\n\t-<a href=\"https://community.simtropolis.com/files/file/26808-vip-girafe-vnaoned-carpack-vol01-vol02-v2/\" rel=\"\">girafe carpack 1 &amp; 2</a><br>\n\t-rush_zakkyo_1-10<br>\n\t-rush_zakkyo_11-20<br>\n\t-rush_zakkyo_20-26<br>\n\tDownload from <a href=\"http://sim4rush.tuzikaze.com/sc4/bat.html\" rel=\"external nofollow\">here</a>, scroll down until you see the following, then click the links shown below:\n</p>\n\n<p>\n\t<img alt=\"66bec1be7bfe6_Rushzakkyo.jpg.ee21ca238535a557d424456cb85de1a4.jpg\" class=\"ipsImage ipsImage_thumbnailed ipsAttachLink_image ipsAttachLink_left\" data-fileid=\"104966\" src=\"https://www.simtropolis.com/objects/attachments/monthly_2024_08/66bec1be7bfe6_Rushzakkyo.jpg.ee21ca238535a557d424456cb85de1a4.jpg\" style=\"width:920px;height:auto;float:left;\" >\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t\_\n</p>\n\n<p>\n\t<strong>Notes</strong><br>\n\tI did not make the model(s) and do not claim any credit for them. The modding of this buildings was made using the <abbr title=\"Plugin Manager\">PIM</abbr>-X tool, so there shouldn't be any problem with these buildings throwing the game off balance.<br>\n\tIf you run into any issues, or want to see other things I'm working on, pay a visit to my lot thread in Simtropolis, you can also PM me here.\n</p>\n\n<p>\n\tEnjoy!\n</p>\n\n\t\t\t\t\t\t</body>"
