    description: "<body>\n                            \n\n\n\n\n\n\t\t\t\t\t\t\t\n<p>\n\tFA2 High Rise Set<br>\n\tBy Kel9505<br>\n\tBased off of EffTheGrid's models: FA2 High Rises 01.\n</p>\n\n<p>\n\tIncluded are eight FA2 lots based off of EffTheGrid's original eyecandy lots and models. \_There are 4 buildings and two lots per building (left and right side for FA2 roads). \_The building stats are as follows:\n</p>\n\n<p>\n\t1. FA2 Cocoa Exchange: Ploppable R$$$ Residential growify lots with 291 residents.\_<br>\n\t2. FA2 Citysphere Growify: Ploppable R$$ Residential growify lots with 1275 residents.<br>\n\t3. FA2 Rhodes Haverty Residence Inn: Ploppable CS$$ lots with 440 workers.<br>\n\t4. FA2 TD Bank at Cadman Plaza: Ploppable CO$$ lots with 2064 workers.\n</p>\n\n<p>\n\tThese are LOTS ONLY, and does not include the model. \_They are a new lots and do not overwrite EffTheGrid's original landmark eyecandy lots.\_\n</p>\n\n<p>\n\tNote: This mod requires DLL dependencies by Null45. \_DLL Dependencies are ONLY available for version 1.1.641 of SimCity 4 (Windows Digital Copies). \_All dependencies listed below are REQUIRED for this <abbr title=\"Residential, Commercial, Industrial\">RCI</abbr> DLL Query Upgrade Mod to work. \_For more information about compatible versions of Simcity4 and DLL mods, see here:<br>\n\t<a href=\"https://community.simtropolis.com/forums/topic/762980-the-future-of-sc4-modding-the-matter-of-digital-vs-disc-and-windows-vs-macos-in-the-dll-era/\" rel=\"\">https://community.simtropolis.com/forums/topic/762980-the-future-of-sc4-modding-the-matter-of-digital-vs-disc-and-windows-vs-macos-in-the-dll-era/</a>\n</p>\n\n<p>\n\t<br>\n\tREQUIRED DEPENDENCIES:<br>\n\t1. <a href=\"https://community.simtropolis.com/files/file/34705-fa2-high-rises-01/\" rel=\"\">FA2 High Rises 01</a>, by EffTheGrid:<br>\n\t2. <a href=\"https://community.simtropolis.com/files/file/36180-growify-plopped-buildings-cheat-dll-plugin/\" rel=\"\">Growify DLL Mod</a> by Null45:\n</p>\n\n<p>\n\tTO INSTALL:\_<br>\n\tMake sure Simcity4 is not running prior to installation.<br>\n\tExtract all files into your Simcity4 Plugins folder. \_The archive can be extracted into a subfolder containing EffTheGrid's models and original lots.\n</p>\n\n<p>\n\tTO USE:<br>\n\tPause the game, plop the respective lot along a FA2 street. \_For the residential lots, use the Growify cheat code \"Growify R M\" or \"Growify R H\" to growify the lot as medium density or high density lots. The commercial lots do not need the growify cheat but can merely be plopped. \_Make sure all lots have water and power or, like any other lot, it may abandon.\_\_If you have the submenu DLL mod by memo, the lots will appear in the Residential Zone menu and Commercial Zones menus under the respective R$$, R$$$, CS$$ and CO$$\_Ploppables submenu item.\n</p>\n\n\t\t\t\t\t\t</body>"
